import React from "react";
import { Grid,  Typography } from "@material-ui/core";

const LeftText = () => {
    return (
        <Grid
            container
            direction="column"
            style={{
                backgroundColor: "#00ff00",
                height: "100%",
                alignItems: "center",
            }}
        >
            <Typography
                variant="h3"
                style={{
                    width: "75%",
                    marginTop: "2%",
                    marginBottom: "2%",
                    textAlign: "center",
                }}
            >
                What is GreenTech?
            </Typography>
            <Typography
                variant="body1"
                style={{
                    width: "75%",
                    marginTop: "2%",
                    marginBottom: "2%",
                    textAlign: "center",
                    fontFamily: "Roboto",
                }}
            >
                climate change and the depletion of natural
                resources.
            </Typography>
            <Typography
                variant="body1"
                style={{
                    width: "75%",
                    marginTop: "2%",
                    marginBottom: "2%",
                    textAlign: "center",
                    fontFamily: "Roboto",
                }}
            >
                Here at GreenTech we specialize in fabricating technology for the future
                out of sustainable materials. From solar panels to reusable rockets,
                GreenTech is here to empower progress and save the planet.
            </Typography>
        </Grid>
    );
};

export default LeftText;
